import { Heading, Button, useColorMode, Icon } from '@chakra-ui/core';
import Layout from '../components/layout/Layout';

const Home = (props) => {
  return (
    <Layout>
      <Heading>HOME</Heading>

      <Button bg='brand.900' color='brand.300' border='0px'>
        Create account
      </Button>
    </Layout>
  );
};

export default Home;
